import styled from "styled-components";

const LandingPageContainer = styled.div`
  display: flex;
  align-items: center;
  align-content: center;
  justify-content: center;
  font-size: 4rem;
  font-family: sofia_probold;
  width: 500px;
  height: 100vh;
`;

export default LandingPageContainer;
